import React from 'react';
// import './serviceProviderProfileNew.css';
import portfolioCover from './portfolioCover.png';
// import Coverphoto from '../Portfolio/Cover_photo/Coverphoto';
import profilePicture from './profilePicture.jpeg';
import pen from './pen.svg'

const Service_provider_portfolio_new = () => {
  return (
    <div style={{padding:"200px"}}>
    <div className='container-fluid mx-0 mb-0' style={{height: 'auto', width: '100%', marginTop: '89px',padding:"0px 2px"}}>
        <div className="cover-row row m-0">
            <div className="portfolio-cover position-relative col-12 m-0 p-0" style={{height: '40vw', height: '40vw', backgroundImage: `url(${portfolioCover})`, backgroundSize: 'auto', backgroundRepeat: 'no-repeat', backgroundSize: 'contain'}}>
                <button type='button' className='edit-cover-btn btn btn-secondary position-absolute me-2 mt-2 opacity-50 top-0 end-0'>Edit Cover</button>
            </div>
        </div>
        

        <div className="profile-details row m-0 p-0" style={{height: '15vw'}}>
            <div className="profile-picture col-3 p-0 m-0 text-center position-relative" style={{height: '100%'}}>
                <img className='profile-img img-fluid rounded-circle p-0 m-0' src={profilePicture} alt="Profile Picture" style={{height: '100%'}} />
                <button type='button' className='edit-profile-btn btn btn-secondary position-absolute me-5 mt-2 opacity-50 bottom-0 end-0'>
                    <img src={pen} alt="" />
                </button>
            </div>

            <div className="profile-details d-flex flex-column col-9 p-0 m-0 justify-content-center">
                <h1 className='display-5'>Flexus Labs</h1>
                <div className="rounded-pill m-0 p-0 px-3 bg-light text-muted" style={{width: 'fit-content'}}><strong>photography</strong></div>

                <div className="details-row row my-4">
                    <div className="contact col-3">Contact</div>
                    <div className="email col-3">E-mail</div>
                    <div className="address col-3">Address</div>
                    <div className="web col-3">Web</div>
                </div>
            </div>

            <div className="description col-11 p-5 rounded my-5 mx-auto text-light bg-secondary">
                Description
            </div>
        </div>

    </div>
    </div>
  );
}

export default Service_provider_portfolio_new;
